window.bookSummaryJSON = "<p><b>You have two options. You die, or you Qualify.</b></p> <p>Sixteen-year-old Gwenevere Lark is determined not only to Qualify but to rescue her entire family.</p> <p>If you are good enough to Qualify, you are eligible to compete in the brutal games of the Atlantis Grail, which grants all winners the laurels, high-tech luxuries, and full privileges of Atlantis citizenship. And if you are in the Top 10, then all your wildest wishes are granted...such as curing your mother's cancer.</p> <p>There is only one problem. Gwen Lark is known as a klutz and a nerd. While she's a hotshot in classics, history, science, and languages, the closest she's come to sports is a backyard pool and a skateboard.</p> <p>This time she is in over her head, and in for a fight of her life, against impossible odds and world-class competition - including Logan Sangre, the most amazing guy in her school, the one she's been crushing on, and who doesn't seem to know she exists.</p> <p>Because every other teen on earth has the same idea.</p> <p>You Qualify, or you die.</p>"; 
